const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14
}

const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  )
}

const Part = (props) => {
  return (
    <p>
      {props.part} {props.ex}
    </p>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part part={props.parts[0].name} ex={props.parts[0].ex}/>
      <Part part={props.parts[1].name} ex={props.parts[1].ex}/>
      <Part part={props.parts[2].name} ex={props.parts[2].ex}/>
    </div>
  )
}

const Total = (props) => {
  return (
    <p>Number of ex {props.parts[0].ex + props.parts[1].ex + props.parts[2].ex}</p>
  )
}


export default App
